import { FaUserMd } from "react-icons/fa";

const GradientIcon = () => {
  return (
    <div className="w-20 h-20">
      <svg width="100%" height="100%" viewBox="0 0 64 64" xmlns="http://www.w3.org/2000/svg">
        <defs>
          <linearGradient id="gradientColors" x1="0%" y1="0%" x2="100%" y2="100%">
            <stop offset="0%" stopColor="#69BDF2" />
            <stop offset="50%" stopColor="#D480F2" />
            <stop offset="100%" stopColor="#FD7D7D" />
          </linearGradient>
        </defs>
        <text x="0" y="50" fontSize="48" fill="url(#gradientColors)" fontFamily="FontAwesome">
          &#xf0f0; {/* Unicode for FaUserMd */}
        </text>
      </svg>
    </div>
  );
};

export default GradientIcon;
